import Login from './components/Login'
import Page16 from './components/Page16'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
function App() {
  return (

    <BrowserRouter>

      <Switch>
        <Route path="/" component={Login} />
        <Route path="/Pag16" component={Page16} />
      </Switch>
      {/* <Login />
    <Page16 /> */}

    </BrowserRouter>
  );
}

export default App;
